// Card.js
import React from 'react';
import '../styles/card.css';

function Card({ event }) {
  return (
    <div className="card">
      <div className="card-content">
        <span className="card-title">{event.date}</span>
        <p>{event.description}</p>
      </div>
      <div className="card-action">
        <a href="#">View Details</a>
      </div>
    </div>
  );
}

export default Card;
